import Header from "./Header";
import './App.css';

function App() {
  return (
    <div className="App col-12">
        <Header />
      <div className='home parallax col-12'>
       <div className='parallax-group col-12'>
           <div className='parallax-layer parallax-back home-back'>
               <div className='cactus' />
               <div className='sand col-12'>
                    <div className='sand-hill hill1' />
                </div>
           </div>
           <div className='parallax-layer parallax-base home-base flex col-12'>
               <h1>Champions</h1>
           </div>
       </div>
      </div>
    </div>
  );
}

export default App;
